$(function(){$(".screenshotframe").dialog({autoOpen:!1,draggable:!1,resizable:!1,show:"blind",hide:"blind",speed:"fast",closeOnEscape:!0,width:"auto",height:"auto"});$(".screenshot").click(function(a){a.stopPropagation();showDialog(this.id+"-frame")});$(".screenshotframe").click(function(a){hideDialog(this.id)});$("#main, #projects").tabs({heightStyle:"content",animate:"easeOutCubic"});$(".button").on("click",function(){ga("send","event","button",this.id)})});
function showDialog(a){$("#"+a).dialog("open");$("body").click(function(){hideDialog(a)});ga("send","event","dialog",a)}function hideDialog(a){$("#"+a).dialog("close")};